import React from "react";

import Header from "../../components/Header";
import Carousel from "../../components/Carousel";

const Homepage = () => {
  return (
    <>
      <Header />
      {/* <Carousel logo="/images/logo.png" /> */}
      <main>
        <div className="ui container">
          <Carousel logo="/images/logo.png" />
        </div>
      </main>
    </>
  );
};

export default Homepage;
